import React from "react";
import "./Items.css";

const Items = (props) => {
  const { items } = props;
  console.log(items);
  const item = items.map((item) => {
    return (
      <div key={e.id}>
        <div>{e.id}</div>
        <div>{e.name}</div>
        <div>{e.age}</div>
      </div>
    );
  });
  return (
    <div>
      List Items
      <div>{item}</div>
    </div>
  );
};

export default Items;
